import React from 'react';
import CategoryItem from '../components/CategoryItem';
import DesignFlyer from '../imgs/graphic-design/graphic-design-poster.png';

const GraphicDesign = () => {
    return (
        <div>

            <section>
                <h2 class="title">Graphic Design</h2>
            </section>
            <section class="padded">
                <div class="container">
                    <div class="row wrap">

                        <CategoryItem image={DesignFlyer} custom={{ height: '100%' }} title="Graphic Design Seminar Flyer" caption="Illustrator" />

                    </div>
                </div>
            </section>
        </div>
    )
}

export default GraphicDesign;
